DROP TABLE IF EXISTS "house_senate_candidates";
CREATE TABLE "house_senate_candidates" ("rowid" INTEGER NOT NULL PRIMARY KEY, "npid" INTEGER NOT NULL, "first_name" VARCHAR(255) NOT NULL, "last_name" VARCHAR(255) NOT NULL, "middle_name" VARCHAR(255) NOT NULL, "junior" VARCHAR(255), "incumbent" SMALLINT NOT NULL, "party" VARCHAR(255) NOT NULL, "vote_count" INTEGER NOT NULL, "ap_winner" SMALLINT NOT NULL, "npr_winner" SMALLINT NOT NULL, "race_id" INTEGER REFERENCES "races" ("rowid") , "candidate_number" VARCHAR(255) NOT NULL, "ballot_order" VARCHAR(255) NOT NULL, "use_junior" VARCHAR(255) NOT NULL);
DROP TABLE IF EXISTS "races";
CREATE TABLE "races" ("rowid" INTEGER NOT NULL PRIMARY KEY, "slug" VARCHAR(255) NOT NULL, "state_postal" VARCHAR(255) NOT NULL, "state_name" VARCHAR(255) NOT NULL, "office_code" VARCHAR(255) NOT NULL, "office_name" VARCHAR(255) NOT NULL, "district_id" INTEGER NOT NULL, "district_name" VARCHAR(255), "precincts_reporting" INTEGER, "total_precincts" INTEGER, "accept_ap_call" SMALLINT NOT NULL, "ap_called" SMALLINT NOT NULL, "ap_called_time" DATETIME, "npr_called" SMALLINT NOT NULL, "npr_called_time" DATETIME, "poll_closing_time" DATETIME, "featured_race" SMALLINT NOT NULL, "prediction" VARCHAR(255), "is_test" VARCHAR(255), "election_date" VARCHAR(255), "county_number" VARCHAR(255), "fips" VARCHAR(255), "county_name" VARCHAR(255), "race_number" VARCHAR(255), "race_type_id" VARCHAR(255), "seat_name" VARCHAR(255), "race_type_party" VARCHAR(255), "race_type" VARCHAR(255), "office_description" VARCHAR(255), "number_of_winners" VARCHAR(255), "number_in_runoff" VARCHAR(255));
DROP TABLE IF EXISTS "states";
CREATE TABLE "states" ("rowid" INTEGER NOT NULL PRIMARY KEY, "id" VARCHAR(255) NOT NULL, "stateface" VARCHAR(255) NOT NULL, "name" VARCHAR(255) NOT NULL, "abbr" VARCHAR(255) NOT NULL, "electoral_votes" INTEGER NOT NULL, "polls_close" VARCHAR(255) NOT NULL, "prediction" VARCHAR(255), "ap_call" VARCHAR(255) NOT NULL, "ap_called_at" VARCHAR(255), "accept_ap_call" SMALLINT NOT NULL, "npr_call" VARCHAR(255) NOT NULL, "npr_called_at" VARCHAR(255), "total_precincts" INTEGER, "precincts_reporting" INTEGER, "rep_vote_count" INTEGER, "dem_vote_count" INTEGER);
